(1, 'Green Valley Estate', 'Green Valley Estate merupakan proyek persembahan Rantaka Group, berupa kawasan perumahan seluas 1.3 Ha (Tahap 1) dengan suasana yang asri, dipadukan dengan fasilitas dan desain rumah modern naturalis yang menjajikan kenyamanan tinggal bagi penghuninya', 'One gate system dengan security 24 jam:Bangunan tahan gempa:Bangunan lebih kedap suara, anti api dan anti rayap:Dinding pembatas 2 bata (terpisah):Spesifikasi bangunan yang unggul dikelasnya:Green Home:Fasilitas Internet (Jaringan Fiber Optic)', 'Serang', '-6.136827', '106.129787', 'Lokasi bersebelahan dengan Citraland Puri Serang:Dekat dengan Mesjid, TK, SD Peradaban (akan segera dibangun):Dekat dengan sarana olahraga GOR Gaharu Serang:20 menit dari gerbang tol Serang Timur dan Serang Barat:10 menit dari pusat kota Serang', 1.2, '2019', 'Batu Kali', 'Dinding Prefab Fibercement diaci tebal 9cm', 'Beton Bertulang Fibercement', 'Keramik Asia Tile 40x40 warna putih & Keramik 20x20 (Kamar Mandi)', 'Bahan Aluminium 3 inci Putih', 'Pintu Star Door (kayu fabrikasi)', 'Bahan Aluminium Putih', 'Konstruksi Baja Ringan', 'Genteng Beton Flat', 'Gypsum (Interior) dan GRC (Eksterior)', 'Pintu PVC', 'Kloset Duduk dan Shower', '1300', 'Sumur Bor + Pompa', 'Beton Rabat', 'Jotun', '1576227029_Green_Valley_Estate_logo.png', '1576661689_Green_Valley_Estate_map.jpg', 'gve_d_1.jpg', 'gve_l_1.jpg', '1576673547_Green_Valley_Estate_harga.jpg', 2250000, 5000000, 1, NULL, '2019-12-18 13:18:52');
